def solution_his(mount, count_days):

    if mount == "May" or mount == "October":
        price_day_studio = 50
        price_day_app = 65

        all_day_studio = price_day_studio * count_days
        all_day_app = price_day_app * count_days

        if (count_days > 7) and (count_days <= 14):
            discount_studio_total = all_day_studio - (all_day_studio / 100 * 5)
            discount_app_total = all_day_app - (all_day_app / 100 * 5)
            return (f"Apartment: {discount_app_total:.2f} lv.", f"Studio: {discount_studio_total:.2f} lv.")

        elif count_days > 14:
            discount_studio_total = all_day_studio - (all_day_studio * 30 / 100)
            discount_app_total = all_day_app - (all_day_app / 100 * 10)
            return (f"Apartment: {discount_app_total:.2f} lv.", f"Studio: {discount_studio_total:.2f} lv.")

        else:
            return (f"Apartment: {all_day_app:.2f} lv.", f"Studio: {all_day_studio:.2f} lv.")

    elif mount == "June" or mount == "September":
        price_day_studio = 75.20
        price_day_app = 68.70

        all_day_studio = price_day_studio * count_days
        all_day_app = price_day_app * count_days

        if count_days > 14:
            discount_studio = all_day_studio - (all_day_studio / 100 * 20)
            discount_app = all_day_app - (all_day_app / 100 * 10)
            return (f"Apartment: {discount_app:.2f} lv.", f"Studio: {discount_studio:.2f} lv.")
        else:
            return (f"Apartment: {all_day_app:.2f} lv.", f"Studio: {all_day_studio:.2f} lv.")

    elif mount == "July" or mount == "August":
        price_day_studio = 76
        price_day_app = 77

        all_day_studio = price_day_studio * count_days
        all_day_app = price_day_app * count_days

        if count_days > 14:
            discount_app = all_day_app - (all_day_app / 100 * 10)
            return (f"Apartment: {discount_app:.2f} lv.", f"Studio: {all_day_studio:.2f} lv.")

        else:
            return (f"Apartment: {all_day_app:.2f} lv.", f"Studio: {all_day_studio:.2f} lv.")

def solution_mine(month, nights):
    if month == "May" or month == "October":
        studio_price = 50
        apartment_price = 65
        if nights > 14:
            studio_price *= 0.7
            apartment_price *= 0.9
        elif nights > 7:
            studio_price *= 0.95
    elif month == "June" or month == "September":
        studio_price = 75.20
        apartment_price = 68.70
        if nights > 14:
            studio_price *= 0.8
            apartment_price *= 0.9
    else:  # July or August
        studio_price = 76
        apartment_price = 77
        if nights > 14:
            apartment_price *= 0.9

    total_studio = studio_price * nights
